import React, { useState, useEffect, Component } from "react";
import { Map, GoogleApiWrapper, Marker } from "google-maps-react";
import mapStyle from "./mapStyle.json";
import axios from "axios";
import { Link } from "react-router-dom";

const MapContainer = (props) => {
  const [markers, setMarkers] = useState([]);
  useEffect(() => {
    axios
      .get(
        "https://iron-cors-anywhere.herokuapp.com/https://maps.googleapis.com/maps/api/place/nearbysearch/json?location=25.76439676537,-80.20731679740429&radius=1500&type=restaurant&key=AIzaSyBibnOWEr72nhfg0dEPgv5Amv09pXcRk_M"
      )
      .then((response) => {
        //setLocations(response.data.results);
        setMarkers(
          response.data.results.map((place) => (
            <Link to={`/each-place/${place.place_id}`}>
              <Marker
                className="marker"
                key={place.place_id}
                title={"marker"}
                name={place.name}
                position={place.geometry.location}
              />
            </Link>
          ))
        );
      });
  }, []);

  return (
    <Map
      className="Map"
      google={props.google}
      zoom={14.5}
      draggableCursor="default"
      styles={mapStyle}
      disableDefaultUI={true}
      zoomControl={false}
      scaleControl={false}
      rotateControl={false}
      gestureHandling="none"
      initialCenter={{
        //25.766917437599158, -80.19897262209749
        lat: 25.766917437599158,
        lng: -80.19897262209749,
      }}
    >
      {markers}
    </Map>
  );
};

export default GoogleApiWrapper({
  apiKey: "AIzaSyBibnOWEr72nhfg0dEPgv5Amv09pXcRk_M",
})(MapContainer);
